import React from "react";
import { View , Text , Image} from "react-native";

const UserCard = (props) => {
    return(
        <View>
            <Image source={{ uri : props.UserData.picture.medium}}/>
            <Text>Name : {props.UserData.name.title +' '+ props.UserData.name.first +' '+ props.UserData.name.last}</Text>
            <Text>Phone Number : {props.UserData.phone}</Text>
            <Text>Address : {props.UserData.location.city} , {props.UserData.location.state}</Text>
            <Text>Gender : {props.UserData.gender}</Text>
        </View>
    );
}

export default UserCard;
